import React from 'react'

import { Component } from 'react'

class Nav extends Component {
    render() {
        return(
            <nav className='nav-wraper cyan darken-2' >
               <div className='container' >
                   <a style={{fontWeight:'300', fontSize:'30px'}} >UBISOFT</a>


                   <ul className='right' >
                       <a>Home</a>
                   </ul>
               </div>
            </nav>


        )
    }
}

export default Nav
